import base64
import tempfile
from google import genai
from PIL import Image
from io import BytesIO
from dotenv import load_dotenv
import os

# Load API key from .env
load_dotenv()
client = genai.Client(api_key=os.getenv("GEMINI_API_KEY"))

# Beispiel: Base64-kodiertes Bild (dieses muss durch eine echte Base64-Zeichenkette ersetzt werden)
img_b64 = ""


# Bild aus Base64 dekodieren und als temporäre Datei speichern
def save_temp_image(img_b64):
    image_data = base64.b64decode(img_b64)
    image = Image.open(BytesIO(image_data))

    with tempfile.NamedTemporaryFile(suffix=".jpg", delete=False) as temp_file:
        image.save(temp_file, format="JPEG")
        return temp_file.name


# Temporäre Datei erstellen
image_path = save_temp_image(img_b64)


# API-Anfrage senden
response = client.models.generate_content(
    model='gemini-2.0-flash',
    contents=[
        'Describe this image in about 100 words.',
        Image.open(image_path)
    ]
)

# Ergebnis ausgeben
print(response.text)

# Temporäre Datei löschen
os.remove(image_path)
